import React from "react";
import "../css_styles/cards.css";
import { Link } from "react-router-dom";
import { Grid, ImageList, ImageListI } from "@mui/material";

const Cards = ({ tech }) => {
  return (
    <div className="card">
      <Grid>
        <Grid item lg={3} md={3} sm={6} xs={6} className="card-ads"></Grid>
        <Link to="/news-detail">
          <Grid item lg={6} md={6} sm={6} xs={6}  className="card-content">
          <ImageList sx={{ width: 500, height: 450 }} cols={3} rowHeight={164}>
            {itemData.map((item) => (
              <ImageListItem key={item.img}>
                <img
                  src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                  srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                  alt={item.title}
                  loading="lazy"
                />
              </ImageListItem>
            ))}
          </ImageList>
            <img src={tech.urlToImage} alt="" />
            <h2 className="cards__title">{tech.title}</h2>
          </Grid>
        </Link>
        <Grid item lg={3} md={3} sm={6} xs={6}  className="card-ads"></Grid>
      </Grid>
    </div>
  );
};

export default Cards;
